		"text": "새해를 맞으며 여러분이 결심한 올해 목표,\n잘 지키고 계신가요?🤔\n혹시 올해도 작심삼일이 되어버린건 아니겠죠?😓\n\n작심삼일 -&gt; 작심일년으로 만들어주는\n상상마당 아카데미의 시즌굿즈 \n&lt;매일매일 합니다 : 해빗트래커&gt;📃\n\n햇빛 맛집 상상마당 아카데미에서\n2022년을 계획해 보자구요😘 https://t.co/JRggzPh4E8"
